import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import '../Styles/menuBar.css';
import imgLine from '../Images/Line.svg';


function logOut(){
    sessionStorage.clear();
    alert('session ended');
    window.location.replace("/");
}

function Greeting(props) {
  const isLoggedIn = props.isLoggedIn;
  if (isLoggedIn) {
    return <>
          <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li> 
          <li className="listMenu" ><a href="!#"><Link to="/myAccount">My Account</Link></a></li>
          <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li> 
          <li className="listMenu" ><a href="!#"><Link onClick={logOut}to="/">Log out</Link></a></li>
          <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li> 
          <li className="listMenu" ><a href="!#"><Link to="/addProduct">Register Product</Link></a></li>
          </>;
  }
};

class MenuBar extends Component  {

  constructor(props) {
    super(props);
    this.state = {
    }; 
  }

render() {

    return(
        <div>
             <ul>
                <li className="listMenu" ><a href="!#"><Link to="/productFeed" state={{ categoryType: "All" }}>All</Link></a></li>
                <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li>
                <li className="listMenu" ><a href="!#"><Link to="/productFeed" state={{ category: "Fruit" }}>Fruit</Link></a></li>
                <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li>
                <li className="listMenu" ><a href="!#"> Vegetables </a></li>
                <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li>
                <li className="listMenu"><a href="!#">Dairy &#38; Eggs</a></li>
                <li className="listMenu"><img src={imgLine} id="Img-Line" alt="Img-Line"/></li>
                <li className="listMenu"><a href="!#">Pantry</a></li>
                <li className="listMenu" ><img src={imgLine} id="Img-Line" alt="Img-Line"/></li>
                <li className="listMenu"><a href="!#">Meat</a></li>
                <Greeting isLoggedIn={this.props.session} />
             </ul>
        </div>
    );
}
}

export default MenuBar;
